import { TSector } from '../../../types/sectorType'

export type ImageContextType = {
  selectedSector?: TSector
  latestImage?: string
  updateSectorId: (sectorId: number) => void
}
export const defaultImageContext: ImageContextType = {
  updateSectorId: (sectorId: number) => {
    console.log('default updateSectorId', sectorId)
  },
}
